import React from "react";
import GenericPage from "../components/Genericpage";
import AdvertisementTableHeader from "../components/";
import AdvertisementTableInfo from "../components/";
import EditButton from "../components/Genericpage";
import DeleteButton from "../components/Genericpage";
import CreateButton from "../components/Genericpage";

const AdvertisementTable = () => {
    return (
        <GenericPage
            tableName="Advertisement Table"
            tableHeaderComponent={<AdvertisementTableHeader />}
            tableInfoComponent={<AdvertisementTableInfo />}
            editButtonComponent={<EditButton />}
            deleteButtonComponent={<DeleteButton />}
            createButtonComponent={<CreateButton />}
        />
    );
};

export default AdvertisementTable;
